import Layout1 from './src/components/Layout1';

class App extends Component {

  constructor() {
      super();
      this.state = {
          greeting: 'Welcome to React Native'
      }
  }


  componentDidMount() {

  }

  componentDidMount() {
    StatusBar.setHidden(true);
 }

  render() {
     return(
      <View>
        <View style={{ backgroundColor: '#ffffff', paddingVertical: 10}}>
          <Text style={{textAlign: 'center', fontWeight: 'bold', fontSize:18 }}>DATA COVID-19 Global & Indonesia</Text> 
        </View>
        <View style={{paddingVertical: 5}}>
        <Text style={{textAlign: 'center', fontWeight: 'bold', fontSize:18 }}>Global </Text>
        </View>
        <Layout1/>
        <Card/>
      </View> 
    )
  }
};

export default App;
